// src/components/OsobaList.js
import React, { useState, useEffect } from 'react';
import { getAllOsoby } from '../services/api';

const OsobaList = () => {
    const [osoby, setOsoby] = useState([]);
    const [isLoading, setIsLoading] = useState(true);

    useEffect(() => {
        const fetchOsoby = async () => {
            try {
                const response = await getAllOsoby();
                setOsoby(response.data);
                setIsLoading(false);
            } catch (error) {
                console.error('Błąd podczas pobierania danych:', error);
                setIsLoading(false);
            }
        };

        fetchOsoby();
    }, []);

    if (isLoading) {
        return <p>Ładowanie...</p>;
    }

    return (
        <div>
            <h1>Lista Osób</h1>
            <table>
                <thead>
                <tr>
                    <th>Imię</th>
                    <th>Nazwisko</th>
                </tr>
                </thead>
                <tbody>
                {osoby.map((osoba) => (
                    <tr key={osoba.id}>
                        <td>{osoba.imie}</td>
                        <td>{osoba.nazwisko}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default OsobaList;
